1	Bring a change to your life today	2018-02-25 23:18:44.300656+00	<section class="published-paragraph" style="font-size:14px;">\r\n<span><p><span>No one plans to get divorced, and when it happens it is a trying event in any individual’s life. In addition to the emotional costs of divorce, the divorce process poses real financial burdens on individuals and families. Here at The Law Offices of Grinberg &amp; Segal, we offer several fixed-price plans for certain types of uncontested divorces in New York and New Jersey. When you choose one of your fixed-price divorce packages, you are ensuring that you will receive the best representation at a very reasonable price. We also offer a number of packages relating to prenuptual agreements, postnuptual agreements, and separation agreements. While we do not offer fixed-price plans for contested divorces, mediation, or adoption cases, we do offer initial hourly retainer agreements for uncontested divorces and adoptions. We encourage you to see our Services field to learn about all of the areas in which we assist clients in New York and New Jersey. &nbsp;If the plan you are looking for is not listed here, please try our Start Your Case with Us Today feature. To ask a quick legal question or learn more about our services, please use our Ask a Question form. You may also schedule a paid consultation to obtain case-specific legal advice from one of our experienced New York/New Jersey family law attorneys.<br></span></p></span></section><section class="published-paragraph"><br>\r\n</section>
3	Court filing fees not included	2018-11-27 02:52:47.302471+00	<p>Court filing fees not included<br></p>
4	Additional Fees	2018-11-27 02:53:36.28385+00	<p>Additional Fees of Defendant Needs to be Served by Professional Process Server: Defendant is in NY/NJ ($500); Defendant is Outside of NY/NJ ($1750)<br></p>
5	Expertise	2018-12-01 01:08:51.485536+00	<p><span>Our skilled family law attorneys use their extensive experience and knowledge of the law to provide the best family law and immigration legal representation to their clients.</span><br></p>
6	Integrity	2018-12-01 01:09:11.278436+00	<p><p><span>Our attorneys hold themselves to the highest ethical standards. Clients know that our expert attorneys are completely honest and forthright about their work.</span></p><br></p>
7	Compassion	2018-12-01 01:09:46.873753+00	<p><span>Our expert attorneys not only offer clients in need expert legal representation, but also offer compassion in the handling of sensitive issues with the utmost care.</span><br></p>
8	Family Law Practice Areas	2018-12-01 05:48:43.101508+00	<p></p><p><span>Our experienced family law attorneys represent clients in almost all areas of New York and New Jersey family law. Please consult the list below to learn more about our practice areas.</span>\r\n</p>\r\n<ul class="list2">\r\n<li>Uncontested Divorce</li>\r\n<li>Contested Divorce</li>\r\n<li>Adoption</li>\r\n<li>Protection</li>\r\n</ul>
9	Attorney Advertising	2018-12-13 02:18:24.436924+00	<p><p><span style="background-color: initial; font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; font-size: 15px;">Prior results do not guarantee similar outcomes.</span><br></p><br></p>
2	Copyright	2018-09-03 01:58:14.485+00	<p></p><p><span></span></p><p><span style="font-size: 15px; background-color: initial;">divorcesus.com is owned and operated by The Law Offices of Grinberg &amp; Segal, PLLC (Grinberg &amp; Segal). The content of divorceus.com is copyrighted and may not be duplicated or used without the prior express permission of Grinberg &amp; Segal. &nbsp;Grinberg &amp; Segal is a New York City family law firm that consists of highly experienced family law attorneys licensed to practice state law in New York and New Jersey and U.S. federal law worldwide.  Grinberg &amp; Segal’s New York-based attorneys represent clients in family law, divorce, and adoption matters in New York and New Jersey. &nbsp;Grinberg &amp; Segal’s family lawyers are skilled and experienced in family law, divorce law, and adoption law and represent clients in New York and New Jersey.</span><br></p><p>COPYRIGHT © 2018 DIVORCE US. ALL RIGHTS RESERVED</p><br><p></p>
