COPY public.gui_asktemplate (id, ask_intro, agreement, disclaimer) FROM stdin;
1	<section class="published-paragraph">\r\n<p>This form allows you to ask one of our experienced family law attorneys a general legal question about New York or New Jersey family law.  Asking a question is absolutely free.  You may also learn more about our family law services that we offer for New York and New Jersey clients.  You may schedule a paid consultation by using our "Online Consultation" form.  Furthermore, you may begin the process of retaining one of our experienced family law attorneys by using the "Start Your Case Today" form.</p>\r\n</section>	<section class="published paragraph">\r\n<p>PLEASE NOTE</br>\r\n===================</br>\r\nYour submission of a question to “Ask a Question” does not create an attorney-client relationship with this firm or with any member of this firm.  The “Ask a Question” feature is designed for you to ask questions about general – family law issues and not fact-specific questions about your case.   The answers provided are not intended, and should not be construed, as constituting case-specific legal advice or guidance and do not create an attorney-client relationship with this firm or any member of this firm.\r\nRetaining an attorney from The Law Offices of Grinberg and Segal, PLLC (hereafter, “the Firm”) requires entering into a written agreement with the Firm, manually signed by you and one of the Firm’s attorneys, and the payment of the required retainer, if applicable.</p></section></br>\r\n\r\n<section class="published paragraph">\r\n<p>PLEASE UNDERSTAND</br>\r\n====================</br>\r\nTo formally engage the Firm you would need to request a written Retainer Agreement from the Firm, execute the Agreement by manually signing and initialing it in all appropriate places and returning it to the Firm by regular mail, and not via email or any other form of electronic communication. Once the original is received, the Retainer will be reviewed and manually signed by the Firm's designated attorney, thus completing the execution of the Agreement. Once the Retainer Agreement is fully executed, you will be provided a copy of the Retainer Agreement and the Firm will keep the original Retainer Agreement in your file with the Firm. Only when the Retainer Agreement is fully executed and the requisite retainer fee is paid by you to the Firm, when applicable, will you become a client of the Firm and a formal lasting attorney-client relationship will be created. Such relationship shall then continue until terminated by either you or the Firm in accordance with the terms of the Retainer Agreement.</p></section></br>\r\n \r\n<section class="published paragraph">\r\n<p>PLEASE FURTHER NOTE</br>\r\n=====================</br>\r\nThat at times, the law may require you to take action (i.e. file an application, file an appeal, file a petition for review, file a motion to reconsider/reopen, etc.) within a specified period of time or you will forever lose your rights to file for said relief or any other benefit to which you may be entitled under the law.  This firm will not be responsible for any such deadline, unless formally engaged in the manner explained above.</p></section>	<p>By submitting a question you acknowledge that you have read this form and acknowledge the contents thereof to be true to the best of your knowledge, and agree to be bound by the terms and conditions set forth above<br></p>
