COPY public.gui_service (id, title, statement, service, description, time_published, nick) FROM stdin;
5	Child Support	Child Support Statement	servces/child_support.jpg	<section class="published-paragraph">\r\n<h3>Child Support</h3>\r\n </section> <section class="published-paragraph">\r\n\r\n<p>In divorces where children are involved, child support may emerge as significant issue.  Child support may be negotiated and agreed upon by the parties in divorce mediations or may be determined and ordered by a judge in contested divorce proceedings.  Child support generally involves  the non-custodial parent of a child making negotiated or court ordered payments to the custodial parent.  Both New York and New Jersey have similar systems for calculating child support obligations. &nbsp;In this article, we will briefly examine a sampling of the significant child support provisions in New York and New Jersey.</p>\r\n </section> <section class="published-paragraph">\r\n\r\n<h4><strong>Child Support in New York</strong></h4>\r\n </section> <section class="published-paragraph">\r\n\r\n<p>The major statutes regarding child support in New York are found in NY Dom Rel L sec. 240  (2016).  The NY statutes define child support as money paid by one or both parents under a court order or under a valid agreement between the parties. If an agreement stipulates a child support amount that deviates from the payer's basic child support obligation under New York law, "the  agreement  or stipulation must specify the amount that\r\n  such basic child support obligation would have been and  the  reason  or\r\n  reasons  that such agreement or stipulation does not provide for payment\r\n  of that amount..." New York law has specific formulas for calculating the basic child support obligation based on an income shares model which takes into account the incomes of both parents and apportions from that a percentage of the income from the non-custodial parent. The New York rules are designed to ensure that child support does not place one party below the federal poverty level.\r\n</p>\r\n </section> <section class="published-paragraph">\r\n\r\n<p>Courts may deviate from the basic child support obligation for the non-custodial parent based on the following factors (paraphrased):\r\n</p>\r\n </section> <section class="published-paragraph">\r\n<section class="shift-right">\r\n<ol>\r\n\t<li>The financial resources of the parents and those of the child;</li>\r\n\t<li>The physical and emotional health of the child and his or her special needs;</li>\r\n\t<li>The standard of living that the child would have had if the marriage or household had not been dissolved;</li>\r\n\t<li>The tax consequences to the parties;</li>\r\n\t<li>The non-monetary contributions that the parties will make toward the well-being of the child;</li>\r\n\t<li>The educational needs of either parent;</li>\r\n\t<li>The determination that the gross income of one parent is substantially less than the other parent’s;</li><li>The needs of the children of the non-custodial parent who are not subject to the child support action in question;</li><li>The financial resources of any person obligated to support the children;</li><li>Provided that the child is not on public assistance, extraordinary expenses incurred by the non-custodial parent in exercising visitation; and</li>\r\n\t<li>Any other factors deemed relevant by the court.</li>\r\n</ol>\r\n</section>\r\n\r\n </section> <section class="published-paragraph">\r\n\r\n<p>It is important to note that spousal support and child support are distinct concepts, but may both be considered in determining the payees financial needs.\r\n</p>\r\n </section> <section class="published-paragraph">\r\n\r\n<h4><strong>Child Support in New Jersey</strong></h4>\r\n </section> <section class="published-paragraph">\r\n\r\n<p>New Jersey's formulas for determining child support are similar to those in New York.  The New Jersey Rules of the Court set the standard that New Jersey will use the “Income Shares Approach” to apportioning child rearing expenses.  This approach is used because New Jersey State law presumes that both parents are responsible for the care of the children. Accordingly, the amount of child support depends on a formula involving the combined income of both parents and the income of the payee. When there is one custodial parent and one non-custodial parent, the approach will be used to ensure that the non-custodial parent makes the requisite contribution to the expenses involved in raising the child. The child support orders may be adjusted pending new evidence.\r\n</p>\r\n<p>Under NJ Rev Stat sec. 2A:34-23 (2016), a court must consider the following factors in determining how much child support is appropriate in divorce proceedings or whether to modify such support (paraphrased):\r\n</p>\r\n </section> <section class="published-paragraph">\r\n<section class="shift-right">\r\n\r\n<ol>\r\n\t<li>The needs of the child;</li>\r\n\t<li>The standard and living and circumstances of each parent;</li>\r\n\t<li>The sources of income of each parent;</li>\r\n\t<li>The earning ability of each parent;</li>\r\n\t<li>The need and capacity of the child for education, including higher education;</li>\r\n\t<li>The age and health of the child and of each parent;</li>\r\n\t<li>The income, assets, and earning ability of the child;</li>\r\n\t<li>The responsibility of the parents for the court-ordered support of others;</li>\r\n\t<li>The reasonable debts and liabilities of each parent; and</li>\r\n\t<li>Any other factors deemed relevant by the court.</li>\r\n</ol>\r\n</section>\r\n </section> <section class="published-paragraph">\r\n<p>The statute notes that child support obligations may not necessarily cease merely on account of the child’s age if the child suffers from severe mental or physical incapacity that hinders his or her ability to be independent.\r\n</p><p>The New Jersey Rules of the Court state that where the parties reach an agreement on child support payments that diverges from the New Jersey formulas, the agreement must state what the child support obligation would be under New Jersey rules and why the amount in the agreement differs from that amount.</p>\r\n<h4><strong>Conclusion</strong></h4>\r\n </section> <section class="published-paragraph">\r\n<p>Child support is one of many complicated issues that may arise in divorce mediation or proceedings where the parties have children. In some cases, the amount of child support may be identical to the amounts stipulated in the New York and New Jersey formulas. In all cases, the experienced family law attorneys at The Law Offices of Grinberg &amp; Segal stand ready to assist clients in matters involving child support and other complicated issues that may arise during the divorce process.</p>\r\n </section>	2017-12-18 02:29:31.2146+00	childsupport
1	Adoption	The gift of family	servces/adoption_FnzTFIO.jpg	<p></p><section class="published-paragraph"><h3><strong>Adoption</strong></h3></section><section class="published-paragraph"><p>Choosing to adopt a child is a life-changing decision both for the adoptive parents and the adopted child. However, the process for adoption is not necessarily straightforward, and prospective adoptive parents must go through the proper procedures in order to complete an adoption. Here, we will provide a brief overview of adoptions in New York and New Jersey along with information about how the experienced family law attorneys at The Law Offices of Grinberg &amp; Segal, PLLC can help guide parents through the adoption process. This article is not intended to be in any way comprehensive, and individuals with case-specific questions should schedule a case-specific consultation.</p></section><section class="published-paragraph"><h4><strong>Adoption in New York</strong></h4></section><section class="published-paragraph"><p>Under New York law, unmarried adults, married adults, and unmarried adults who are living together may adopt a child. Two adults living together who seek to adopt a child may be of the same sex or different sexes. A person who is married but living separate and apart from his or her spouse under a separation decree, judgment, or divorce may adopt a child. Finally, an adult married person who has been living separate and apart from his or her spouse for at least three years may seek to adopt a child. It is worth noting that an adoption may not be denied on grounds of race; religion; fertility; gender preference; marital status; income; employment; or education.</p></section><section class="published-paragraph"><p>New York state law recognizes two distinct adoption procedures for adoptions that take place in New York State.</p></section><section class="published-paragraph"><p>First, there is the “agency adoption” process. In this process, an agency authorized by New York places a child in a home for adoption. To adopt a child under this process, the prospective parent(s) must work with an approved adoption agency. The agency will be required to screen prospective parent(s) to ensure that the child will be placed in a safe and suitable home environment. In order to commence the agency adoption process, the prospective parent(s) must file an application in court. After filing for adoption, parent(s) will be required to undergo what is called a “home study process.” The adoption agency will be required to assess the suitability of the prospective parent(s) to care for the specific child. Adoption proceedings require the submission to the court of extensive documentation establishing the suitability of the parent(s) and the eligibility of the child to be adopted. For this reason, adoptive parents are strongly advised to retain an experienced adoption attorney for guidance through the process.</p></section><section class="published-paragraph"><p>The second process is called the “private placement” process. Under this process, the child is put up for adoption by his or her birth parent(s) rather than by an authorized adoption agency. Accordingly, the prospective adoptive parent(s) must enter into an agreement with the birth parent(s). Parent(s) seeking to adopt a child through private placement will be required to obtain certification as qualified adoptive parents from a court of competent jurisdiction under New York law. The issues considered by the court for certification are similar to those considered in the agency adoption process. Also similarly, the adoption must be approved through adoption proceedings in court.</p></section><section class="published-paragraph"><p>In order to adopt a child who resides in the United States but not in New York state, prospective parent(s) will first have to obtain permission for the child to be moved in accordance with the provisions of the Interstate Compact on the Placement of Children (ICPC).</p></section><section class="published-paragraph"><h4><strong>Adoptions in New Jersey</strong></h4></section><section class="published-paragraph"><p>In New Jersey, a single adult, married adults, or adults in a domestic partnership or civil union may adopt a child.</p></section><section class="published-paragraph"><p>Similar to New York, children in New Jersey may be adopted privately or through an approved adoption agency. If the prospective parent(s) are seeking to adopt from an approved agency, they will, as they would in New York, be required to undergo a home study. If the adoption agency determines that the prospective parent(s) are suitable, it may, in its discretion, attempt to match the parent(s) with a child who the agency believes would be a good fit in the home. Once a pairing is settled upon, New Jersey law requires that the child must reside with the prospective adoptive parent(s) for six months before they may file what is called a “complaint for adoption” with the court. The agency must also consent to this application. The court reviews the qualifications of the parents, the situation of the child, and renders a decision based on the agency’s report and whether the adoption would promote the best interests of the child.</p></section><section class="published-paragraph"><p>With regard to private adoptions, prospective parents are permitted to pay or reimburse the birth parent for medical, hospital, counseling, or other similar expenses in connection with the birth or any illness of the child, or any <em>reasonable&nbsp;</em>living expenses of the mother during her pregnancy. However, these payments may not continue beyond four weeks after the termination of the pregnancy by birth or otherwise. A prospective adoptive parent is well advised to consult with an experienced family law attorney for guidance on the rules surrounding such reimbursement.</p></section><section class="published-paragraph"><p>As is the case in New York, a parent in New Jersey seeking to adopt a child from out of state must first obtain permission for the child to move through the ICPC.</p></section>\r\n\r\n<section class="published-paragraph">\r\n\r\n<h4><strong>Conclusion</strong></h4></section>\r\n<section class="published-paragraph">\r\n<span>\r\nAt the Law Offices of Grinberg &amp; Segal, PLLC, our attorneys understand how special providing an adoptive child with a loving home is, and we are ready to provide our expertise to help parents through the process. It is highly recommended that prospective adoptive parent consult with a family law attorney early in the adoption process.</span>\r\n</section>\r\n<section class="published-paragraph">\r\n<p></p><p><span>Please note that the experienced family law attorneys at The Law Offices of Grinberg &amp; Segal, PLLC, are also experts in all areas of immigration law, including international adoption. For those who are interested in learning about international adoption, please the website of the <a href="http://myattorneyusa.com/" data-vivaldi-spatnav-clickable="1">immigration law division of The Law Offices of Grinberg &amp; Segal, PLLC</a>.</span></p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p><span>\r\n</span></p><p><span style="font-size: 16px; background-color: initial;">You may start with our section devoted to international adoption:</span><br></p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>\r\n<a href="http://myattorneyusa.com/international_adoption" data-vivaldi-spatnav-clickable="1"><span style="font-size: 14px;">http://myattorneyusa.com/international_adoption</span></a>\r\n</p>\r\n</section>	2017-12-18 02:29:31.2146+00	adoption
11	Spousal Support	Spousal Support, Alimony Statement	servces/alimony_two.jpg	<section class="published-paragraph">\r\n<h3>Spousal Support</h3><p><strong></strong>Spousal support, or alimony, is the regular payment by one party in a divorce to another to provide financial support during or after a divorce or separation process and/or after a divorce is completed.  The amount of spousal support may be an issue that is agreed upon by the parties in negotiations.  If the parties do not agree and the divorce is contested, a court may order spousal support if it sees fit depending on the specific facts of the case. In this article, we will provide a very brief overview of alimony in New York and New Jersey.</p><h4>Alimony in New York</h4>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>The main statutes concerning alimony in New York are found in NY Dom. Rel. L. sec. 236 (2016).</p><p>New York law provides for "temporary maintenance" payments during divorce proceedings. Temporary maintenance terminates upon the culmination of the proceedings. The parties may reach their own agreement regarding temporary maintenance. &nbsp;However, if no such agreement is reached, the court may order temporary maintenance to be paid by the party with higher income to the party with lower income. The New York Courts website maintains a “Temporary Maintenance Online Calculator” which is based on the temporary maintenance factors outlined in statute. &nbsp;These formulas are designed to prevent the payer from falling below an income level at which he or she can sustain him or herself.</p></section>\r\n<section class="published-paragraph">\r\n<p>New York's statutes also provide for post-divorce maintenance. payments. Alimony to be paid after a divorce is finalized can either be negotiated by the parties or ordered by a court based on the formulas in the New York statutes. In some cases, alimony may be paid as a single sum payment. "Maintenance" is defined as an agreed upon payment schedule, or a court-ordered payment schedule, where support is "paid at fixed intervals for a definite or indefinite payment of time..."</p><p>Post-divorce maintenance is calculated before child support is calculated. It is important to note that notwithstanding divorce maintenance factors, the amount of maintenance awarded cannot reduce the payer's income below the self-support reserve for a single person. Where a court orders maintenance, the duration of such maintenance will generally depend on the length of the marriage.</p><p>Courts have discretion to deviate from the post-divorce maintenance guidelines based on several factors. &nbsp;These factors are listed in statute and paraphrased here:</p><p></p>\r\n</section>\r\n\r\n<section class="published-paragraph shift-right">\r\n<ul><li>The age and health of the parties;</li><li>The present or future earning capacity of the parties;</li><li>The need of one party to incur training or education expenses;</li><li>The termination of a child support award before the termination of the maintenance award when the calculation of maintenance was based on child support being awarded which resulted in a maintenance award lower than it would have been...;</li><li>The wasteful dissipation of marital property;</li><li>The existence and duration of a pre-marital joint household or post-divorce separate household;</li><li>Acts by one party against another that have inhibited or continue to inhibit a party's earning capacity or ability to obtain meaningful employment;</li><li>The availability or cost of medical insurance for the parties;</li><li>The care of children or stepchildren, disabled adult children or stepchildren, elderly parents or in-laws provided during the marriage that inhibits a party's earning capacity;</li><li>The tax consequences to each party;</li><li>The standard of living of the parties established during the marriage;</li><li>The reduced or lost earning capacity of the payee as a result of having foregone or delayed education, training, employment or career opportunities during the marriage;</li><li>The equitable distribution of marital property and the income or imputed income on the assets so distributed;</li><li>The contributions and services of the payee as a spouse, parent, wage earner and homemaker to the career potential of the other party;</li><li>Any other relevant factors.</li></ul><p>Post-divorce maintenance ceases upon the death of either party or the remarriage of the receiving party. It can, in some cases, be modified.</p>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n<h4>Alimony in New Jersey</h4>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n<p>The main New Jersey statute involving alimony is NJ Rev Stat sec. 2A:34-23 (2016).</p><p>The provision sets forth four types of alimony: open durational alimony; rehabilitative alimony; limited duration alimony; or reimbursement alimony. In considering which type of alimony to award, New Jersey courts must consider the following non-exhaustive list of factors:</p>\r\n</section>\r\n\r\n<section class="published-paragraph shift-right">\r\n<ul><li>The actual need and ability of the parties to pay;</li>\r\n<li>The duration of the marriage or civil union;</li>\r\n<li>The age [and the] physical and emotional health of the parties;</li>\r\n<li>The standard of living established in the marriage or civil union and the likelihood that each party can maintain a reasonably comparable standard of living, with neither party having a greater entitlement to that standard of living than the other;</li><li>The earning capacities, educational levels, vocational skills, and employability of the parties;</li><li>The length of absence from the job market of the party seeking maintenance;</li><li>The parental responsibilities for the children;</li><li>The time and expense necessary to acquire sufficient education or training to enable the party seeking maintenance to find appropriate employment, the availability of the training and employment, and the opportunity for future acquisitions of capital assets and income;</li><li>The history of financial or non-financial contributions to the marriage or civil union by each party...;</li><li>The equitable distribution of property ordered and any payouts on equitable distribution, directly or indirectly, out of current income...;</li><li>The income available to either party through investments of any assets held by that party;</li><li>The tax treatment and consequences to both parties of any alimony award...;</li><li>The nature, amount, and length of any pendite lite support paid, if any; and</li><li>Any other factors which the court may deem relevant.</li></ul>\r\n</section>\r\n\r\n\r\n\r\n<section class="published-paragraph">\r\n<p>Barring "exceptional circumstances," for cases in New Jersey involving marriages or civil unions that lasted less than 20 years, the duration of alimony will not exceed the length of the marriage or civil union. "Exceptional circumstances" are defined in statute.</p><p>Rehabilitative alimony is awarded based upon a rehabilitation plan of the payee and may be modified. &nbsp;Reimbursement alimony may be awarded "under circumstances in which one party supported the other through an advanced education, anticipating participation in the fruits of the earning capacity generated by that education" and may not be modified under any circumstances. Other types of alimony may be subsequently modified based on specified factors. Alimony will generally terminate upon death, re-marriage, or (in most cases) the retirement of the obligor.</p><p></p></section><section class="published-paragraph"><h4>How We Can Help</h4>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>Alimony can often be one of the most contentious issues in a divorce, especially where there exists a significant difference in income between the parties. At The Law Offices of Grinberg &amp; Segal, PLLC, our expert family law attorneys have extensive experience both in representing clients in mediation and in contested divorce proceedings before a judge. An experienced family law attorney can ensure that the rights and interests of a party regarding alimony and other issues arising in a divorce are protected. Please remember that is article is only a summary of major alimony provisions in New York and New Jersey, and each case will require a fact-specific inquiry in light of all of the laws and regulations of the state in question.</p>\r\n</section>	2017-12-18 02:29:31.2146+00	spousalsupport
2	Agreements	Crafting valid agreements before or after marriage	servces/Cohabitation-Agreement.jpg	<section class="published-paragraph">\r\n<h3><strong>Agreements</strong></h3></section>\r\n<section class="published-paragraph">\r\n<p>A divorce may occur under the terms of an agreement.  Such an agreement is a written contract between the two parties to the divorce that provides for the division of money, and property, spousal support, and the care and custody of children.  Furthermore, the parties may enter into an agreement before a marriage, during a marriage, or before the dissolution of a marriage regarding the disposition of marital assets in the event of a divorce.\r\n</p><p>In this post, we provide a very brief overview of agreements in New York and New Jersey. Any individual case will present a unique set of issues.</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<h4><strong>New York Divorce Ground for Separation Agreement</strong>\r\n</h4>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>One of New York’s seven legal grounds for divorce involves an agreement.  NY Dom Rel L sec. 170 (2016) explains that if the husband and wife have lived separate and apart for one or more years under the terms of a separation agreement, and the plaintiff establishes that he or she performed all of the terms of the agreement, this may be used as a ground for divorce.\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<h4><strong>Agreements Made Before or During a Marriage</strong></h4>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>NY&nbsp;Dom Rel L sec. 236 (2016)&nbsp;explains that an agreement made between the parties before or during a marriage will be valid so long as it is in writing, subscribed to by the parties, and properly recorded as a deed. &nbsp;Such agreements may include, but are not limited to:</p>\r\n<section class="shift-right">\r\n<ul>\r\n<li>Contract to make a testamentary provision;&nbsp;<br></li>\r\n<li>A waiver of any right to elect against the provisions of a will;<br></li><li>Provision for the ownership, division, or distribution of separate and marital property;<br></li><li>Provision for the amount and duration of maintenance (alimony)&nbsp;or other terms and conditions of the marital relationship; or<br></li><li>Provision for child custody or support.<br></li></ul>\r\n</section>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n<p>New Jersey has similar laws at NJ Rev Stat 37:2-34 (2016). &nbsp;Under these provisions, a premarital (or pre-civil union)&nbsp;agreement may include:</p>\r\n<section class="shift-right">\r\n<ul><li>The rights or obligations of each party to the property of either party or both parties;</li><li>The right to manage or control property;</li><li>The disposition of property upon separation, marital dissolution, the death of one of the parties, or the occurrence or nonoccurrence of any other event;</li><li>The modification or elimination of support;</li><li>The making of a will or trust;</li><li>The ownership rights and disposition of a death benefit or life insurance policy;</li><li>The choice of law governing the construction of the agreement; or</li><li>Any other matter that is not a violation of public policy.</li></ul>\r\n</section>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n\r\n<p>One party may argue that such an agreements is unenforceable. If a party establishes that he or she did not have the opportunity to consult with legal counsel, an agreement may be found to be unenforceable. Furthermore, if one party was not forthright about his or her earnings, property, and/or financial obligations when entering into the agreement, the agreement may be found to be unenforceable. Finally, if one party establishes that he or she entered into the agreement under duress, the agreement may be found to be unenforceable. The burden will be upon the party alleging that the agreement is unenforceable to establish such. For example, in NJ Rev Stat sec. 37:2-38 (2016), the burden is on the party alleging the agreement is unenforceable to prove such by “clear and convincing evidence.”<br></p><h4><strong>Agreements in Lieu of Proceedings</strong></h4></section>\r\n<section class="published-paragraph">\r\n<p>In seeking a divorce, the parties may seek to resolve their disagreements by way of coming to an agreement, sometimes through the formal process of divorce mediation.  Coming to an agreement may spare the parties from months of litigation in contested divorce proceedings.  While such an agreement may not be the appropriate resolution in every situation, it is worth considering by the parties and their attorneys whether it is possible to resolve disputed issues without a court order.\r\n</p>\r\n<h4><strong>Note on Custody of the Children</strong>\r\n</h4>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>Notwithstanding any agreements, a judge is required to consider, first and foremost, the best interests of the child in making any child custody determinations.  While a judge will consider any agreements entered into between the parties concerning the custody and support of children, he or she will still have the discretion to render an order contrary to the agreement if such would serve the best interests of the child.\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<h4><strong>Conclusion</strong>\r\n</h4>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>When entering into an agreement with a spouse or fiancée, it is wise to consult with an experienced family law.  Firstly, if an agreement is not well-written with respect to the relevant laws of the state, it may do little to resolve the issues.  Secondly, if there is a lack of regularity in the process of entering into an agreement, this may lead to one party challenging its validity and enforceability at a later date.  Finally, an attorney may help his or her client review the agreement carefully to ensure that the client understand all it entails.  At The Law Offices of Grinberg &amp; Segal, PLLC, we have extensive experience in reviewing agreements, helping parties reach agreements (before or during marriage as well as after the commencement of a divorce action), and ensuring that the rights and interests of our clients are protected.\r\n</p>\r\n</section>	2017-12-18 02:29:31.2146+00	agreements
4	Child Custody	Child Custody Statement	servces/child_custody.jpg	<section class="published-paragraph">\r\n<h3>Child Custody</h3>\r\n</section> \r\n\r\n<section class="published-paragraph">\r\n<p>One of the most important, and often the most contentious, issues that may arise during divorce negotiations or proceedings is that of child custody.  Child custody can be negotiated through mediation or determined by a judge in the course of divorce or separation proceedings.  Whether through proceedings or through an agreement, there may be a variety of custody arrangements from one parent having sole custody, both parents sharing joint custody, or any other arrangement that is found to be in the best interests of the child.  In most cases, a parent who is not granted joint or sole physical custody of the child will still be able to seek visitation rights.  It is crucial for a parent who is facing divorce to consult immediately with an experienced family law attorney for guidance on how to protect his or her interests as a parent in the course of divorce mediation or divorce proceedings. &nbsp;In this article, we will provide a brief overview of some of the significant child custody provisions in New York and New Jersey.</p>\r\n</section> \r\n\r\n<section class="published-paragraph">\r\n<h4>Child Custody and Visitation in New York</h4>\r\n</section> \r\n\r\n<section class="published-paragraph">\r\n<p>Under New York law, “custody” has two components.  First there is the concept of “legal custody.”  A parent with legal custody has the right to make decisions regarding the child’s upbringing.  The second concept is “physical custody.”  A parent with physical custody has actual day-to-day physical care and control of a child under the age of 18.\r\n</p>\r\n</section> \r\n<section class="published-paragraph">\r\n<p>A parent may petition for custody in Family Court, or the issue may be decided in divorce proceedings \r\nbefore an order of divorce is granted.  Neither parent is presumed to have a greater right to custody of the child before an assessment of the facts of the case. Under NY Dom Rel L sec. 240 (2016), judges must consider the “best interests of the child” in determining custody and visitation. The statutes provide a detailed list of factors that must be considered in child custody cases. The website for the New York State Unified Court System provides a condensed summary of factors considered by courts in determining custody and visitation (paraphrased):\r\n</p>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<section class="shift-right">\r\n<ul><li>Which parent has been the main care giver/nurturer of the child;</li><li>The parenting skills of each parent and the ability of each parent to provide for the child's special needs (when applicable);<br></li><li>The mental and physical health of each parent;<br></li><li>Any instances of domestic violence (when applicable);<br></li><li>The work schedules and care plans of each parent;<br></li><li>The child's relationship with the rest of his or her family;<br></li><li>The wishes of the child (depending on the age of the child); and<br></li><li>Each parent's ability to cooperate with the other parent and encourage a relationship between the child and the other apparent (absent safety concerns).<br></li></ul>\r\n</section>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>The above list of factors is non-exhaustive, and courts may consider other relevant factors in making decisions in child custody cases. &nbsp;Any instances of domestic violence or other safety concerns will weigh heavily in determining the "best interests of the child" in a given case. &nbsp;The New York Unified Court System makes clear that the paramount concerns in decisions are the "child's health and safety."</p>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>Before issuing a temporary or permanent custody or visitation order, the court is required to review all related decisions in court proceedings in family court (if applicable) before issuing an order.  In the event a situation requires expeditious action to serve the best interest of the child, the court may issue a temporary emergency order for custody or visitation.\r\n</p>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<h4><strong>Child Custody and Visitation in New Jersey</strong></h4>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>Under NJ Rev Stat sec. 9:2-4 (2016), the public policy of New Jersey is to assure that parents share parental responsibility after separation or divorce.  However, under section 9:2-4A, “the best interest of the child” is a primary consideration “notwithstanding any provisions of the law to the contrary.”  Courts may decide on joint custody, sole custody (with appropriate parenting time for the non-custodial parent), or any other custody arrangement that is determined to be in the best interests of the \r\nchild.  The statute lists the following non-exhaustive list of factors that courts must consider, where applicable, in making a custody determination:\r\n</p>\r\n</section> \r\n<section class="published-paragraph">\r\n<section class="shift-right">\r\n<ul><li>The parents’ ability to agree, communicate, and cooperate regarding the child;<br></li><li>The parents’ willingness to accept custody and history of unwillingness to allow parenting time not based on substantiated abuse;<br></li><li>The interaction and relationship of the child with [his or her] parents and siblings;<br></li><li>The history of domestic violence, if any;<br></li><li>The safety of the child and the safety of either parent from physical abuse from the other parent;<br></li><li>The preference of the child when of sufficient age and capacity to reason as to form an intelligent decision;<br></li><li>The needs of the child;<br></li><li>The stability of home environment offered;<br></li><li>The quality and continuity of the child’s education;<br></li><li>The fitness of parents;<br></li><li>The geographical proximity of the parents’ homes;<br></li><li>The extent and quality of time spent by each parent with the child prior to or subsequent to the separation;<br></li><li>The parents’ employment responsibilities; and<br></li><li>The age and number of children.<br></li></ul>\r\n</section>\r\n\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>The court will not determine a parent to be "unfit" unless his or her conduct has a "substantial adverse effect on the child." &nbsp;Certain sexual assault or contact convictions specified in section 9.2:4-1 preclude a parent from being awarded custody.</p>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>If the parents reach a custody arrangement, the court will order the arrangement unless it determines that the arrangement is contrary to the best interests of the child.</p><p>If the parents do not agree on an arrangement, the court may require each parent to submit a custody plan to be considered in making a determination.\r\n</p>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>The court may appoint a guardian or an attorney to represent the best interests of the child.\r\n</p>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<h4><strong>How We Can Help</strong></h4>\r\n\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>This article provides a brief overview of some issues that may come up in child custody determinations.  At the Law Office of Grinberg &amp; Segal, PLLC, we understand the difficult issues that child custody presents in divorces and separations.  Our expert attorneys can help clients with all aspects of child custody issues in case-specific contexts in New Jersey and New York.</p>\r\n</section>	2017-12-18 02:29:31.2146+00	custody
9	Property	Property Statement	servces/property.jpg	<section class="published-paragraph">\r\n<h3><strong>Property</strong></h3>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>Property may arise as one of the more significant issues in divorce mediation or divorce proceedings. This is especially true in cases where the value of the property is significant. The parties can execute an agreement regarding property division prior to or during the marriage that will generally control upon termination of the marriage.  Both New York and New Jersey have statutes and adjudicative principles regarding property division. This article will provide a brief introduction to the complicated subject of property division. It is in no way intended to be comprehensive, and each case presents its own specific circumstances.</p>\r\n</section> <section class="published-paragraph">\r\n<h4><strong>Property Division in New York</strong></h4>\r\n</section> <section class="published-paragraph">\r\n<p>New York Law recognizes two different types of property with regard to divorce proceedings.\r\n</p>\r\n</section> <section class="published-paragraph">\r\n<p>NY Dom. Rel. L. sec. 236 (2016) distinguishes "marital property" and "separate property" for purpose of divorce. Marital property means all property acquired by one or both parties during the marriage and before the execution of a separation agreement or the commencement of a matrimonial action. Marital property is subject to distribution in a divorce. "Separate property" encompasses property that is not subject to division. Separate property includes property acquired before marriage, property acquired by bequest, devise, or descent, property that is a gift from someone other than the spouse, compensation for personal injuries, property acquired in exchange for or the increase in value of separate property (except insofar as the appreciation of value is due to the contributions or efforts of the other spouse), and property described as separate property by written agreement of the parties.</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>Valid written agreements entered into prior to or during the marriage are enforceable with regard to property division. In cases without an agreement between the parties, property will be distributed under the principle of "equitable distribution." &nbsp;This does not mean that the property will be divided equally, but rather "equitably" in light of the following factors<span style="background-color: initial; font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; font-size: 15px;">:</span></p></section> \r\n<section class="published-paragraph">\r\n<section class="shift-right">\r\n<ol>\r\n\t<li>The income and property of each party at the time of marriage, and at the time of the commencement of the action;</li>\r\n\t<li>The duration of the marriage and the age and health of both parties;</li>\r\n\t<li>The need of the custodial parent to occupy or own the marital residence and to use or own its household effects;</li>\r\n\t<li>The loss of inheritance and pension rights upon dissolution of the marriage as of the date of dissolution;</li>\r\n\t<li>The loss of health insurance benefits upon dissolution of the marriage;</li>\r\n\t<li>Any award of maintenance [under New York law];</li>\r\n\t<li>Any equitable claim to, interest in, or indirect contribution made to the acquisition of any such marital property by the party not having title...;</li>\r\n\t<li>The liquid or non-liquid character of all marital property;</li>\r\n\t<li>The possible future financial circumstances of each party;</li>\r\n\t<li>The impossibility or difficulty of evaluating any component asset or any interest in a business, corporation[,] or profession, and the economic desirability of retaining such asset or interest intact and free from any claim or interference by the other party;</li>\r\n\t<li>The tax consequences to each party;</li>\r\n\t<li>The wasteful dissipation of assets by either spouse;</li>\r\n\t<li>Any transfer or encumbrance made by either party in contemplation of dissolution of the marriage; and</li>\r\n\t<li>Any other factor deemed relevant by the court.</li>\r\n</ol>\r\n</section>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>The statute gives the court the discretion to find that equitable distribution is inappropriate or  would be impractical or burdensome in a given case.  This could be relevant in cases where the major assets at issue cannot be practically divided.  The court may have discretion in the latter cases to order a distributive award to achieve equity between the parties.</p>\r\n</section> <section class="published-paragraph">\r\n\r\n<h4><strong>Property Division in New Jersey</strong></h4>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>Like New York, New Jersey also uses the principle of equitable distribution for property division.  Furthermore, New Jersey makes a similar distinction between “marital property” and “separate property” as New York does.  Under NJ Rev Stat sec 2A:34-23.1 (2016), judges are required to consider the following non-exhaustive list of factors in determining equitable distribution in a given case (note that all references to “marriage” include “civil unions”):\r\n</p>\r\n</section> <section class="published-paragraph">\r\n<section class="shift-right">\r\n\r\n<ol>\r\n\t<li>The duration of the marriage;</li>\r\n\t<li>The age and physical and emotional health of the parties;</li>\r\n\t<li>The income or property brought to the marriage by each party;</li>\r\n\t<li>The standard of living established during the marriage;</li>\r\n\t<li>Any written agreement made before or during the marriage regarding property distribution;</li>\r\n\t<li>The economic circumstances of each party at the time the division of property becomes effective;</li>\r\n\t<li>The income and earning capacity of each party, including educational background, training, employment skills, work experience, length of absence from the job market, custodial responsibilities for children, and the time and expense necessary to acquire sufficient education or training to enable the party to become self-supporting at a standard of living reasonably comparable to that enjoyed during the marriage;</li>\r\n\t<li>The contribution by each party to the education, training, or earning power of the other;</li>\r\n\t<li>The contribution of each party to the acquisition, dissipation, preservation, depreciation or appreciation in the amount or value of the marital property, or the property acquired during the civil union as well as the contribution of a party as a homemaker;</li>\r\n\t<li>The tax consequences of the proposed equitable distribution to each party;</li>\r\n\t<li>The present value of the property;</li>\r\n\t<li>The need of the parent who has physical custody of a child to own or occupy the marital residence or residence ... and to use or own the household effects;</li>\r\n\t<li>The debts and liabilities of the parties;</li>\r\n\t<li>The need for creation, &nbsp;now or in the future, of a trust fund to secure reasonably foreseeable medical or educational costs for a spouse ... or children;</li>\r\n\t<li>The extent to which one party deferred to the other in achieving [his or her] &nbsp;career goals; and</li>\r\n\t<li>Any other factors deemed to be relevant by the court.</li>\r\n</ol>\r\n</section>\r\n\r\n<p>Interestingly, agreements are to be considered under the list of New Jersey equitable distribution factors.</p>\r\n</section> <section class="published-paragraph">\r\n<h4><strong>Conclusion</strong></h4>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>Despite the fact that both New York and New Jersey have detailed criteria regarding their equitable distribution laws and the distinction between “marital” and “separate” property, property division is often one of the most complicated aspects of a divorce.  The experienced family law attorneys at The Law Offices of Grinberg &amp; Segal, PLLC, stand ready to assist clients with property division.  Our attorneys can review agreements reached prior to or during a marriage or can protect the interests of their clients during divorce mediation or divorce proceedings.  Our attorneys are always ready to help ensure a just and fair settlement of property by agreement, by mediation, or by judicial determination.</p>\r\n</section>	2017-12-18 02:29:31.2146+00	property
10	Protection	Protection Statement	servces/protection.jpg	<section class="published-paragraph">\r\n<h3>Protection</h3>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>In divorce cases involving domestic violence by one party against the other or against children, it may be necessary for the victim to seek what is called an “order of protection” in New York or a “restraining order” in New Jersey.  A judge may issue such and order, which prohibits the abusive party from contact with a spouse or child and/or from engaging in certain activities.  Both New York and New Jersey have specific statutes regarding such orders. This article will provide a brief intr<b>od<b>ucti</b>o</b>n to the issue.</p>\r\n</section> <section class="published-paragraph">\r\n\r\n<h4>Orders of Protection in New York</h4>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>The provisions regarding orders of protection in New York are found in NY Dom Rel L sec. 240 (2016).\r\n</p>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>Under this statute, an order of protection or temporary order of protection may be entered against one party in a divorce proceeding as part of a final judgment of divorce, in child custody/visitation proceedings, or prior to or subsequent to the entry of a final judgment.  An order of protection entered during divorce proceedings may remain in effect after a final judgment.  The order of protection need not necessarily be based on conduct that happened contemporaneously with the request.  The protected party cannot be held to violate an order of protection in effect against the abusive party.\r\n</p>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>The statute lists conduct that an order of protection may require from any party:\r\n</p>\r\n</section> <section class="published-paragraph">\r\n<section class="shift-right">\r\n<ol>\r\n\t<li>To stay away from the home, school, business, or place of employment of one party or the child, or any other specific location designated by the court;</li>\r\n\t<li>To permit a parent, or a person entitled to visitation by a court order or a separation period, to visit the child at stated periods;</li>\r\n\t<li>To refrain from committing a family offense [as defined in New York law], or criminal offense against the child or against the other parent or against any person to whom the custody of the child is awarded or from harassing, intimidating or threatening such persons;</li>\r\n\t<li>To permit a designated party to enter the residence during a specified period of time in order to remove personal belongings not in issue in a proceedings or action under this chapter or the family court act;</li>\r\n\t<li>The refrain from acts that would create an unreasonable risk to the health, safety, or welfare of the child;</li>\r\n\t<li>To pay the reasonable counsel fees and disbursements involved in  obtaining or enforcing the order of the person who is protected by such order if such order is issued or enforced;</li>\r\n\t<li>To refrain from intentionally injuring or killing, without justification, any companion animal [(as defined in New York law)] the respondent knows to be owned, possessed, leased, kept or held by the person protected by the order or a minor child residing in such person's household...;</li>\r\n\t<li>To promptly return specified identification documents to the protected party, in whose favor the order of protection or temporary order of protection issued...</li>\r\n\t<li>To observe such other conditions as are necessary to further the purposes of protection.</li>\r\n</ol>\r\n</section>\r\n\r\n<p>New York has further statutes detailing the scope and procedures involving orders of protection. &nbsp;This section is intended to provide a list of things that an order of protection may include.</p>\r\n</section> <section class="published-paragraph">\r\n<h4>Restraining Orders in New Jersey</h4>\r\n</section> <section class="published-paragraph">\r\n<p>In New Jersey, a domestic violence victim may seek a restraining order in Family Court.  NJ Rev Stat sec. 2C:25-29 (2016) contains factors that court must consider in making a decision regarding the issuance of a restraining order:\r\n</p>\r\n</section> <section class="published-paragraph">\r\n<section class="shift-right">\r\n<ol>\r\n\t<li>The previous history of domestic violence between the plaintiff and defendant, including threats, harassment and physical abuse;</li>\r\n\t<li>The existence of immediate danger to person or property;</li>\r\n\t<li>The financial circumstances of the plaintiff and defendant;</li>\r\n\t<li>The best interests of the victim and of any child;</li>\r\n\t<li>In determining custody and parenting time the protection of the victim's safety; and</li>\r\n\t<li>The existence of a verifiable order of protection from another jurisdiction.</li>\r\n</ol>\r\n</section>\r\n</section> <section class="published-paragraph">\r\n\r\n<p>In the event that a restraining order is granted, courts may craft its terms to meet the needs presented in a specific case. &nbsp;Under the New Jersey statute, an order of protection may include any or all of the following (condensed):\r\n</p>\r\n</section> <section class="published-paragraph">\r\n\r\n<section class="shift-right">\r\n<ol>\r\n\t<li>An order restraining the defendant from subjecting the victim to domestic violence, as defined [in New Jersey law];</li>\r\n\t<li>An order granting exclusive possession to the plaintiff of the residence or household regardless of whether the residence or household is jointly or solely owned by the parties or jointly or solely leased by the parties...;</li>\r\n\t<li>An order providing parenting time. &nbsp;The order shall protect the safety and well-being of the plaintiff and minor children and shall specify the place and frequency of parenting time...;</li>\r\n\t<li>An order requiring the defendant to pay the victim monetary compensation for losses suffered as a direct result of the act of domestic violence...;</li>\r\n\t<li>An order requiring the defendant to receive professional domestic violence counseling from either a private source or a source appointed by the court...;</li>\r\n\t<li>An order restraining the defendant from entering the residence, property, school, or place of employment of the victim or of other family or household members of the victim and requiring the defendant to stay away from any specified place that is named in the order and is frequented regularly by the victim or other family or household members;</li>\r\n\t<li>An order restraining the defendant from making contact with the plaintiff or others...;</li>\r\n\t<li>An order requiring that the defendant make or continue to make rent or mortgage payments on the residence occupied by the victim...;</li>\r\n\t<li>An order granting either party temporary possession of specified personal property...;</li>\r\n\t<li>An order awarding emergency monetary relief...;</li>\r\n\t<li>An order awarding temporary custody of a minor child. &nbsp;The court shall presume that the best interests of the child are served by an award of custody to the non-abusive parent;</li>\r\n\t<li>An order requiring that a law enforcement officer accompany either party to the residence or any shared business premises to supervise the removal of personal belongings...;</li>\r\n\t<li>An order granting any other appropriate relief for the plaintiff and dependent children...;</li>\r\n\t<li>An order that requires the defendant to report to the intake unit of the Family Part of the Chancery Division of the Superior Court for monitoring of any other provision of the order;</li>\r\n\t<li>In addition to the order [required under law] prohibiting the defendant from possessing any firearm, [] an order prohibiting the defendant from possessing any other [specified under New Jersey law] weapon...;</li>\r\n\t<li>An order requiring the defendant to undergo a psychiatric evaluation;</li>\r\n\t<li>An order directing the possession of any animal owned, possessed, leased, kept, or held by either party or a minor child residing in the household.</li>\r\n</ol>\r\n</section>\r\n</section> \r\n<section class="published-paragraph">\r\n<p>In situations where there is immediate danger, a victim may seek to obtain an emergency restraining order.\r\n</p>\r\n</section> <section class="published-paragraph">\r\n\r\n<h4>How We Can Help</h4>\r\n</section> \r\n<section class="published-paragraph">\r\n\r\n<p>No family law matter is more serious than one where the safety an individual and/or his or her children is involved. &nbsp;The New York and New Jersey family law attorneys of The Law Offices of Grinberg &amp; Segal, PLLC, have extensive experience handling the most sensitive cases, including those involving domestic violence and orders of protection. &nbsp;Our compassionate attorneys stand ready to assist clients most in need, assessing each case on its own merits and vigorously representing the interests of clients.</p><p>Please note that our experienced New York and New Jersey family law attorneys also represent immigration clients nationwide in all areas of immigration law. To learn about forms of relief that are available for certain domestic violence victims in some cases under the immigration laws, please see the <a href="http://myattorneyusa.com/tag/vawa">relevant section on the website for our immigration law division</a>.</p></section><section class="published-paragraph">\r\n</section>	2017-12-18 02:29:31.2146+00	protection
3	Contested Divorce	Contested Divorces - Where the parties disagree	servces/contested.jpeg	<section class="published-paragraph">\r\n<h3><strong>Contested Divorce</strong>\r\n</h3>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>A contested divorce occurs when one party in the proceeding opposes a divorce action.  This can mean that one part does not want to get a divorce, disagrees on the grounds of divorce, or disagrees on important issues in a divorce such as child custody, the allocation of property/assets, or post-divorce support.\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>A contested divorce can be a lengthy and – sometimes – contentious process.  Divorces are civil matters and a contested divorce may be resolved by a judge under the laws of the state in which it occurs.  For example, the New York Courts System advises that a contested divorce will require the parties to go to Supreme Court “numerous times.”  NJ Court Rule 5:1-4 explains that the length of time that it may take for a contested divorce to be resolved will depend upon the issues presented.  Certain matters may be placed on the “standard” track, whereas more complicated cases may be placed on the “Complex Track” and take longer.  Cases that involve custody or parenting-time issues may be placed on the “Priority Track” for expeditious adjudication of these issues in the best interest of the child(ren).\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>In short, a contested divorce is a lawsuit.  It will involve pleadings, discovery motions, and potentially a trial before a judge (and in some cases, a jury).  It is extremely important to consult with an experienced divorce attorney if a divorce is contested, both to ensure that one’s interests are protected and that every avenue is explored for a potentially amicable solution (if appropriate).  Judges will make child custody determination, and either party can request that a judge make a determination on select other matters at issue in the divorce (such as property division or spousal support).\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>In certain cases, it may be possible for the parties to reach a resolution without going to trial.  This can be accomplished through the parties coming to an agreement, whether through an informal process or through formal mediation.  Experienced family law attorneys may be able to help the parties see if there is a way to resolve the issues involved in the divorce without having to go through complex divorce proceedings.  However, certain cases may not be amenable to such a resolution.  Such cases may include those where one party is unwilling to negotiate, where the sides are too far apart on key issues, or situations where domestic violence is involved.\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>The experienced family law and divorce attorneys at The Law Office of Grinberg &amp; Segal, PLLC, are experts in handling all aspects of divorce proceedings – contested or uncontested – in New York and New Jersey.  Our attorneys always seek the best solution for clients, whether through a negotiated agreement or defending the interests of clients before a judge in a divorce trial. Every contested divorce case is unique, and may vary in complexity depending the number of disputed points, children, and assets at issue.</p>\r\n</section>	2017-12-18 02:29:31.2146+00	contested
8	Mediation	Mediation Statement.	servces/mediation.jpg	<section class="published-paragraph">\r\n<h3>Mediation</h3><p>Through mediation, the parties may come to an agreement on how to resolve contentious issues relating to a divorce without having to go to trial.  Mediation may be appropriate in cases where there is enough common ground between the parties to resolve the issues without a judge.  Furthermore, pursuing a divorce agreement through mediation may lead to a more amicable settlement than what would be possible in court proceedings.  However, mediation may not be possible in every case. In cases where the parties are too far apart, where one party is unwilling to negotiate, or where there has been domestic violence, divorce mediation may not be a viable option.</p>\r\n</section><section class="published-paragraph">\r\n<p>If you decide to retain an attorney for divorce mediation, his or her role will be different than in adversarial proceedings before a court.    The job of the attorney in divorce mediation is to represent you in working with the other party to reach an agreement that is acceptable to both sides on all of the issues related to divorce, while ensuring that your rights and interests are protected.  An expert family law attorney can be an indispensable asset in the mediation setting with his or her experience and knowledge of the relevant state laws.  For example, an experienced family law attorney will be able to assist clients in achieving, among other things, an equitable division of assets, mutually agreeable child custody terms, and appropriate child and  spousal support payments,  all while taking into account  your best interests in light of the financial and other relevant implications of the sensitive issues being discussed in the mediated dissolution of the marriage.</p>\r\n</section><section class="published-paragraph">\r\n<p>At The Law Offices of Grinberg &amp; Segal, PLLC, our experienced family law attorneys have the skills and temperament necessary to assist clients in New York and New Jersey in the mediation context. We take pride in helping clients resolve their differences through divorce mediation where possible, and by effect helping them and their families avoid potentially protracted and expensive divorce proceedings before a judge.  Our attorneys are always enthusiastic about being able to help parties come to a fair resolution in mediation and, in so doing, avoid protracted contentious proceedings in court.</p>\r\n</section>	2017-12-18 02:29:31.2146+00	mediation
7	Consultation	Consultation Statement.	servces/free_consult.jpg	<section class="published-paragraph">\r\n<p></p></section><h3>Consultation</h3><p>The experienced family law attorneys of The Law Offices of Grinberg &amp; Segal, PLLC, offer reasonably priced family law consultations for clients with New York and New Jersey family law questions. You may consider scheduling a consultation with us if you are looking for professional legal advice on case-specific family law matters.</p><p>We offer consultations over the telephone, in person, and online using Skype. Depending on your case, you may purchase one of our two types of consultations.</p><p>First, we offer a 15-minute uncontested divorce consultation for $49. The uncontested divorce consultation is intended to provide professional legal advice on case-specific uncontested divorce questions and give a client an idea of how he or she should proceed.</p><p>Second, we offer a 45-minute general New York/New Jersey family law consultation for $160. This consultation is for general family-law questions. Our experienced attorneys have found that 45 minutes is sufficient for providing a detailed, case-specific consultation that will give a client the information that he or she needs to decide how to proceed in a specific case.</p><p>In order to request a consultation, please go to our <u>online consultation</u>&nbsp;field, select your consultation, and begin answering a few short questions so that we can learn about you and your case. Before you begin, it is important for you to know that we are&nbsp;bound&nbsp;to preserve the complete confidentiality of all information that you provide to us on the consultation form and in your consultation. We will never share your information with a third party. The information you provide will be used solely to help ensure that we have enough information to be prepared to offer you the best consultation. Accordingly, please make sure to fill out every required field on the consultation form accurately and completely.<br></p><section class="published-paragraph"><p>  In order to make a payment, you must use the secure payment portal found on our “Make a Payment” page.  We accept all major credit cards including Visa, Master Card, American Express, and Discover. You must complete the payment information in order to schedule your consultation.</p></section><section class="published-paragraph">\r\n<p>Once we receive your completed request for a consultation, one of our experienced family law attorneys will contact you in the manner you prefer, by telephone, Skype, or email, to schedule your consultation.\r\n</p>\r\n</section><section class="published-paragraph">\r\n<p>Please note that our divorce attorneys only handle family law cases in New York and New Jersey.\r\n</p>\r\n</section><section class="published-paragraph">\r\n<p>If you have a you need professional legal advice on a case-specific question regarding U.S. immigration law, please consider scheduling an &nbsp;immigration consultation with one of our experienced immigration attorneys over at our immigration website:</p><p>https://myattorneyusa.com/online-consultation<br></p>\r\n</section>	2017-12-18 02:29:31.2146+00	consultation
12	Uncontested Divorce	Uncontested Divorce is the divorce by mutual agreement.	servces/uncontested.jpg	<strong>\r\n<h3>Uncontested Divorce</h3>\r\n</strong>\r\n\r\n<section class="published-paragraph">\r\n<p>An uncontested divorce results when the parties involved in a divorce agree on all of the pertinent issues without the need of  a trial, and the decree of divorce is entered by the court based upon the agreed upon uncontested terms.  The issues requiring agreement may include, but are not limited to:  the division of property and assets; spousal support and child support; and child custody.  The parties may reach such an agreement at the beginning of the process, through mediation, or at any time before a judge issues a final decision following a trial. Where practicable and where the parties can agree to fair terms, an uncontested divorce may save both sides money and the prospect of potentially acrimonious and protracted divorce proceedings.</p>\r\n</section><section class="published-paragraph">\r\n<p>Even if the divorce is uncontested, both parties must specify &nbsp;the specific ground of divorce under New York or New Jersey law (whichever is applicable). Both New York and New Jersey maintain similar lists of specified divorce grounds recognized under law.</p>\r\n</section><section class="published-paragraph">\r\n<p>If a party fails to respond to a divorce summons or complaint or a divorce summons with notice, a judge may issue a default judgment against that party, which will preclude that party from contesting the divorce and the terms specified in the summons, complaint, or summons with notice.\r\n</p>\r\n</section><section class="published-paragraph">\r\n<h4><strong><b>Uncontested Divorce in New York</b></strong></h4>\r\n</section><section class="published-paragraph">\r\n<p>A divorce in New York may be uncontested if the parties agree on the legal grounds for divorce and reach a settlement of all the issues without judicial proceedings.  It is possible to reach such an amicable agreement either at the very start or through ensuing mediation.  The most common ground for divorce in uncontested cases is the irreconcilable differences ground.  However, the uncontested divorce may be based on any of the legally sufficient grounds.</p>\r\n</section><section class="published-paragraph">\r\n<h4><strong>Uncontested Divorce in New Jersey</strong></h4>\r\n</section><section class="published-paragraph">\r\n<p>Uncontested divorces in New Jersey work similarly to uncontested divorces in New York.  The parties may seek an uncontested divorce if they can agree on issues involving property and assets, children, and spousal support.  Under the NJ Court Rule 5:1-4, an uncontested divorce where the parties have reached an agreement and where the parties were married for less than five years may be placed on the expedited track. Expedited track cases may be resolved more quickly than other cases.\r\n</p>\r\n</section><section class="published-paragraph">\r\n<strong><h4>How We Can Help</h4></strong>\r\n</section><section class="published-paragraph">\r\n<p></p><p>Uncontested divorces are not possible or necessarily\r\nadvisable in every case.&nbsp; However, where\r\nthe parties agree on all of the pertinent issues, an uncontested divorce can\r\nsave time, money, and allow both sides to amicably move on with their\r\nlives.&nbsp; Uncontested divorces are\r\ngenerally more likely in cases where the parties do not have significant assets\r\nto divide, large disparities in income, and/or children.&nbsp; However, uncontested divorces can occur in\r\nmore complicated cases.</p><p></p><p>At The Law Offices of Grinberg &amp; Segal, PLLC, we pride\r\nourselves on offering the best legal representation for clients in New York and\r\nNew Jersey who are seeking an uncontested divorce.&nbsp; We are committed to ensuring that the rights\r\nand interests of all of our clients are protected.</p><p></p><p>We offer several New York and New Jersey uncontested divorce\r\npackages at very reasonable prices.&nbsp; In\r\norder to purchase one of our uncontested divorce packages, you will first have\r\nto schedule a consultation for an assessment of your case.&nbsp; We generally recommend our special\r\nuncontested divorce consultation for clients who are only inquiring about a\r\npotential uncontested divorce, although we may discuss issues involving\r\npotential uncontested divorces in our other consultation types.&nbsp; If we determine that your case is a New York\r\nor New Jersey uncontested divorce case and one in which one of our experienced\r\nfamily attorneys can be of service to you, you may use your invoice number from\r\nthe consultation to purchase one of our uncontested divorce packages.</p><p><p>\r\n\r\n</p><p>Finally, we also offer services\r\nfor couples who are working on coming to an agreement to avoid a costly\r\ncontested divorce.&nbsp; We can address more\r\ncomplicated cases in our general consultation (see our other <u>services</u> to\r\nlearn more).</p></p><p><a href="https://divorcesus.com/pricing/">https://divorcesus.com/pricing/</a><br></p>\r\n</section>	2017-12-18 02:29:31.2146+00	uncontested
6	Domestic Violence	Domestic Violence Statement	servces/domestic.jpg	<section class="published-paragraph">\r\n<h3><strong>Divorce and Domestic Violence</strong></h3>\r\n<p>There is no more urgent cause for divorce or legal separation than domestic violence and/or abusive conduct by one partner of the marriage toward his or her spouse and/or child(ren).  The experienced family law attorneys at the Law Offices of Grinberg &amp; Segal, PLLC stand ready to offer their expert counsel and compassion to a client who has suffered domestic violence in his or her marriage and who is dealing with the fallout from the violence and abuse in his or her divorce proceedings.</p></section><section class="published-paragraph">\r\n<h4><strong>New York and New Jersey Divorce Grounds Involving Domestic Violence</strong></h4>\r\n<p>Both the New York and New Jersey State divorce laws include domestic violence against a spouse as a legal ground for divorce.\r\n</p>\r\n<p>New York State law defines “cruel and inhuman” treatment of the plaintiff by the defendant as a ground for divorce.  In order to satisfy the statute, the cruel and inhuman treatment must endanger the plaintiff’s “physical or mental well-being” such that it renders it unsafe or improper for the plaintiff to continue cohabiting with the defendant. NY Dom Rel L sec. 170 (2016).</p></section><section class="published-paragraph">\r\n<p>New Jersey State law includes conduct constituting “extreme cruelty” towards the plaintiff by the defendant as a ground for divorce.  The statutory definition includes both “physical and mental cruelty,”   which must either endanger the safety or health of the plaintiff or make it improper or unreasonable to expect the plaintiff to continue to cohabit with the defendant. &nbsp;NJ Rev Stat sec. 2A:34-2 (2016). New Jersey also includes as a divorce ground “deviant sexual conduct” performed by the defendant without the consent of the plaintiff..\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n\r\n<h4><strong>Other Family Law Concerns Involving Domestic Violence</strong></h4>\r\n<p>Before pursuing divorce, it is crucial for a victim of domestic violence to ensure his or her safety.  An experienced attorney will be able to guide the domestic violence victim in obtaining potentially necessary forms of relief, such as an order of protection.  In proceedings, an attorney can help ensure that the victim’s address and personal information will be kept from his or her abuser.\r\n</p>\r\n\r\n<p>Indeed, domestic violence often complicates divorce actions in that the circumstances of abuse and cruelty may make it impossible to resolve issues through out-of-court mediation rather than through formal court proceeding.  In such cases, an experienced attorney can help the victim defend his or her safety and future in court.\r\n</p>\r\n<p>If a party to divorce proceedings presents evidence that he or she was the victim of domestic violence, many aspects of the ultimate resolution of the divorce petition can be affected.  This may be true even if the domestic violence is not the ground upon which the divorce is based.  The following is a non-exhaustive list of matters that may be affected by allegations or evidence of spousal domestic violence or cruelty:\r\n</p>\r\n<section class="shift-right">\r\n<ul>\r\n\t<li>Child custody/visitation determinations (evidence of domestic violence against either the parent or child will be considered in custody and visitation determinations);</li>\r\n\t<li>Child support;</li>\r\n\t<li>Alimony/spousal support (<i>e.g., </i>NY Dom Rel L sec. 236 (2016) provides that domestic violence will be considered in any temporary maintenance determination insofar as the domestic violence inhibited or continues to inhibit the victim’s capacity to gain employment);</li>\r\n\t<li>Allocation of marital assets.</li>\r\n</ul>\r\n</section>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n<p>Other unique issues may also arise depending on the facts and the state.  For example, in New Jersey, divorced couples with children are generally required to undergo a “Parent’s Education program” in order to promote cooperation between divorced parents with regard to child rearing. NJ Rev Stat sec. 2A:34-12.3 (2016). However, the statute recognizes that the “cooperation may sometimes be inappropriate in cases of domestic violence.”</p>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n\r\n<h4><strong>Conclusion</strong></h4>\r\n<p>There are no more serious family law cases than those involving domestic violence. At The Law Office of Grinberg and Segal, PLLC, we are committed to representing those who are most in need. The facts of each case are unique, and it is crucial for a victim of domestic violence to have his or her interests and safety protected in family law proceedings. We would like to remind readers that we also represent clients in complex immigration matters nationwide. Those who are interested in forms of immigration relief for domestic violence victims may consult the relevant <a href="http://myattorneyusa.com/tag/vawa" style="">section of the website for our immigration law division</a>.</p>\r\n</section>	2017-12-18 02:29:31.2146+00	domesticviolence
