1	Why Choose Us	It takes many good deeds to build a good reputation, and only one bad one to lose it.”  - Benjamin Franklin	At the Law Offices of Grinberg & Segal, PLLC, our expert family law attorneys use their knowledge and extensive experience in New York and New Jersey family law to provide clients with the best expert representation they can find.  However, our experienced family law attorneys do not owe their stellar reputation solely to their legal skill, but also to how they approach each and every client and case.  Whether you simply need an attorney to review forms relating to a marriage or divorce agreement, or need help with a more complex matter such as adopting a child or navigating complicated divorce proceedings, our attorneys will bring their impeccable professionalism and care and compassion to assist you.	We do not just believe our clients deserve the best counsel; we stake our reputation on our ability to deliver it.  If you choose to work with us on your family law issue, you can rest assured that you and your case will get the expert care and utmost respect that it deserves, all for a very reasonable price.
